import React from "react";
import "./home.css";
import Hero from "../../components/Global/Hero/hero";

const Home = () => {
  return (
    <div>
      <h1>Welkom bij KLJ Keerbergen</h1>
      <p>
        Op deze website kan je kleren kopen voor jouw kinderen die in de KLJ van
        Keerbergen zitten!
      </p>
      <button>Catalogus bekijken</button>
    </div>
  );
};

export default Home;
